import React from 'react';

const cartItem = (props) => {
    return (
        <div className={classNames.CartItem}>
            <span>
                <img>{props.product.image}</img>
                <span>{props.product.title}</span>
                <span>{props.product.price}</span>
            </span>
        </div>
    )
}

export default cartItem
